#!/usr/bin/env node

const fs = require('fs');
const path = require('path');

// Find the processed JSON file
const fileName = '4b091709-ef5f-4b47-9d60-bbd36184f402_processed.json';
const filePath = path.join(__dirname, fileName);

console.log(`Reading file: ${filePath}`);

// Read the JSON file
let data;
try {
  const rawData = fs.readFileSync(filePath, 'utf8');
  data = JSON.parse(rawData);
} catch (error) {
  console.error('Error reading or parsing JSON file:', error.message);
  process.exit(1);
}

console.log(`Initial state:`);
console.log(`  pPrefixGroups: ${data.pPrefixGroups.length} items`);
console.log(`  otherGroups: ${data.otherGroups.length} items`);

// Separate P- prefixed items from others
const pPrefixItems = [];
const otherItems = [];

data.otherGroups.forEach(item => {
  if (typeof item === 'string' && item.startsWith('P-')) {
    pPrefixItems.push(item);
  } else {
    otherItems.push(item);
  }
});

// Also check if any P- items are already in pPrefixGroups (shouldn't be, but just in case)
data.pPrefixGroups.forEach(item => {
  if (typeof item === 'string' && item.startsWith('P-')) {
    pPrefixItems.push(item);
  } else {
    // If there are non-P- items in pPrefixGroups, move them to otherItems
    otherItems.push(item);
  }
});

// Update the data structure
data.pPrefixGroups = pPrefixItems;
data.otherGroups = otherItems;

console.log(`After processing:`);
console.log(`  pPrefixGroups: ${data.pPrefixGroups.length} items`);
console.log(`  otherGroups: ${data.otherGroups.length} items`);
console.log(`  Moved ${pPrefixItems.length} P- prefixed items to pPrefixGroups`);

// Create backup of original file
const backupPath = filePath.replace('.json', '_backup.json');
try {
  fs.copyFileSync(filePath, backupPath);
  console.log(`Backup created: ${backupPath}`);
} catch (error) {
  console.error('Error creating backup:', error.message);
  process.exit(1);
}

// Write the corrected data back to the file
try {
  fs.writeFileSync(filePath, JSON.stringify(data, null, 2));
  console.log(`File updated successfully: ${filePath}`);
} catch (error) {
  console.error('Error writing file:', error.message);
  process.exit(1);
}

console.log('✅ JSON file grouping fixed successfully!');

